var mongoose = require('mongoose');
mongoose.connect("mongodb://localhost/yelpcamp_v6");

var Campground = require('./models/campground');
var Comment = require('./models/comment');	

var data = [
	{
		name: "Salmon Creek",
		image: "data:image/jpeg;base64,",
		description: "Hi this is first one"
	},
	{
		name: "Granite Hill",
		image: "data:image/jpeg;base64,",
		description: "This is the Second Yelpcamp!"
	},
	{
		name: "Mountain Goat's Rest",
		image: "data:image/jpeg;base64,",
		description: "It's the third one"
	}
]

function seedDB(){
	Campground.remove({},function(err){
		if(err){
			console.log(err);
		}else{
			console.log("Removed Campgrounds");
			Comment.remove({});
			data.forEach(function(seed){
				Campground.create(seed,function(err,campground){
					if(err){
						console.log(err);
					}else{
						console.log("added a campground");
						Comment.create({text: "This place is beautiful but wish there was internet"},function(err,comment){
							if(err){
								console.log(err);
							}else{
								campground.author.id = "5eb55d97f454944c0405de31";
								campground.author.username = "pushpendra";
								comment.author.id = "5eb55d97f454944c0405de31";
								comment.author.username = "pushpendra";
								comment.save();
								campground.comments.push(comment);
								campground.save();
							}
						})
					}
				})
			})
		}
	})
}

module.exports = seedDB;